INSERT INTO `recommend` (`reco_id`, `food_name`, `food_desc`, `food_calories`, `food_carbohydrates`, `food_picture`, `exercise`) VALUES
(1, 'Whole Eggs.\r\nLeafy Greens.\r\nSalmon.\r\nCruciferous Vegetables.\r\nLean Beef and Chicken Breast\r\nBoiled Potatoes.\r\nTuna.\r\nBeans and Legumes.', 'Lean Red Meat: Steak contains a ton of protein and iron. Red meat is high in cholesterol, so most food professionals don’t recommend it as part of a healthy diet more than a few times per week.\r\nReal Nut Butters: Natural peanut butter is packed with protein and fats, making it a great choice for people trying to gain weight the healthy way. One tablespoon contains around 100 calories and has 4 grams of protein.\r\nWhole Fat Milk: Dietitians say that one simple substitution you can make when trying to gain weight is swapping your skim milk for whole milk. It’s only 60 calories more a glass as the fat is left in.\r\nTropical Fruit: Fruits like mango, papaya, bananas, and pineapple are amazing choices according to food experts. They are full of natural sugars and can give you great energy.\r\nAvocado: These delicious green vegetables are an excellent way to add heart-healthy fats to your diet. One half of an avocado contains 140 calories, but also contain high levels of potassium, folic acid, and vitamin E.\r\nNatural Granola: Natural granola with no added refined sugar is a great cereal to enjoy if you are trying to gain weight. This tasty snack is made from rolled oats, sugar, and healthy fats (like nuts and coconut oil). More dried fruit and nuts can also be added.\r\nWhole Wheat Bread: Nutritionists say that eating healthy bread products is a great way to start gaining weight. If you’re adding bread to your diet, look for whole grains.\r\nNuts: Nuts are a great snack for gaining weight. They are full of fat and nutrients, but also contain a great deal of fiber. Eating only a handful of nuts can keep you full for hours. Not all nuts are equal for fiber though.\r\nCheese: Try goat cheese with eggs, Swiss with roasted chicken, and Parmesan on top of asparagus. On its own, cheese also makes a great snack because it’s high in protein.', '2000-200 (kcals/day)', '500gm', , 'Pushups\r\nPullups\r\nSquats\r\nLunges\r\nBench press\r\nOverhead press');
INSERT INTO `recommend` (`reco_id`, `food_name`, `food_desc`, `food_calories`, `food_carbohydrates`, `food_picture`, `exercise`) VALUES
(2, 'Vegetables\r\nFruits\r\nWhole grains\r\nLean protein\r\nHealthy fats', 'Vegetables: Always a smart choice, aim to fill about half your plate with veggies. Add plenty of cruciferous veggies like broccoli, leafy greens, as well as colorful options like peppers.\r\n\r\nFruits: Go for fresh fruit whenever possible and try a variety of colors. Berries, grapes, apples, and grapefruits make great choices.\r\n\r\nWhole grains: Eating grains in their whole form provides additional fiber and nutrients. This includes brown rice, oats, and 100% whole grain breads.\r\n\r\nLean protein: High in protein and relatively low in fat, lean proteins include grilled chicken, ground turkey, and white fish.\r\n\r\nHealthy fats: Fatty fish, such as salmon and tuna, as well as nuts, such as walnuts, provide essential omega-3 fatty acids. Avocados are a great source of beneficial unsaturated fats.', '2,093 calories', '218 grams carbs', , '');
INSERT INTO `recommend` (`reco_id`, `food_name`, `food_desc`, `food_calories`, `food_carbohydrates`, `food_picture`, `exercise`) VALUES
(3, 'Whole grains (whole wheat, steel cut oats, brown rice, quinoa)\r\n\r\nVegetables (a colorful variety-not potatoes)\r\n\r\nWhole fruits (not fruit juices)\r\n\r\nNuts, seeds, beans, and other healthful sources of protein (fish and poultry)\r\n\r\nPlant oils (olive and other vegetable oils)', 'Today’s world is full of daily stresses. This is a normal part of life, but when these stresses become too much, they can take a toll on health and contribute to weight gain by leading to unhealthy eating and other unhealthy activities.\r\n\r\nOne of the best ways to control stress is also one of the best ways to combat weight gain: regular physical activity. Mind body approaches, such as breathing exercises, can also be beneficial.', '1600 (kcals/day)', '280gm carbs', , '');
INSERT INTO `recommend` (`reco_id`, `food_name`, `food_desc`, `food_calories`, `food_carbohydrates`, `food_picture`, `exercise`) VALUES
(4, 'Choose minimally processed, whole foods:\r\nWhole grains (whole wheat, steel cut oats, brown rice, quinoa)\r\n\r\nVegetables (a colorful variety-not potatoes)\r\n\r\nWhole fruits (not fruit juices)\r\nNuts, seeds, beans, and other healthful sources of protein (fish and poultry)\r\n\r\nPlant oils (olive and other vegetable oils)\r\nDrink water or other beverages that are naturally calorie-free', 'A low fat diet, as the name implies, is a dietary pattern that limits the fat intake at about 1/3 of the total daily calories consumed. It consists of little fat, particularly saturated fats and cholesterol which lead to increased blood cholesterol levels and heart attack.\r\n\r\nThis type of diet plan to reduce obesity focuses on foods that contain whole grains, fruits and vegetables. It is directed towards weight loss and treatment of certain diseases by offering 20 to 30 percent of total daily calories from fat. Plenty of vegetables and proteins in a typical low fat diet supply the body with energy but very little fats.\r\n\r\nHowever, fats should not be eliminated entirely as some dietary fat is needed for good health, supplying energy and fat soluble vitamins like A, D, E and K. Studies have revealed that the right kinds of fats can actually help in losing weight. Hence, the prime focus of healthy diet plan for obesity is on limiting the unhealthy fats and consumption of right amounts of fats.\r\n\r\nLow-fat diets have been promoted for the prevention of heart disease. Lowering fat intake from 35-40% of total calories to 15-20% of total calories has been shown to decrease total and LDL cholesterol by 10 to 20%; however, most of this decrease is due to a reduction in saturated fat intake.\r\n\r\nWe create an Indian diet chart for people facing obesity. Follow this diet plan and start eating those food items which listed in breakfast, lunch and dinner timings.', '1600 (kcals/day)', '280gm carbs', , '');

